    height: 400px;
    width: 300px;
    background: #fff;
    opacity: 50%;
    border: 1px solid #bbb;
    border-radius: 10px;
    position: relative;
`

const Glass = ({ children }) => {
    <GlassBack>
        {/* <GlassFront>
